import React from 'react';
import Layout from '../components/MyLayout';

const Cart = (props) => {
  const { cartItems } = useContext(UserContext);

  return(
    <Layout>
      <h1>Welcome to the cart page</h1>
      <h2>List:</h2>

      <h3>
        <ul>
          {cartItems.map(show => (
            <li key={show.imdbID}>

            </li>
          ))}
        </ul>
      </h3>
    </Layout>
  )
}

export default Cart;
